INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (2, -416.5, 100, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130011, "ヤマト", 1, 2.1, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 3001, 3001100);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (2, -416.5, 101, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130011, "ヤマト", 4, 5.68, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 3001, 3001101);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 102, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130011, "ヤマト", 1, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 3001, 3001102);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 100, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 1, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 3002, 3002100);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 101, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 1, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 3002, 3002101);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (2, -416.5, 102, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 5, 8.53, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 3002, 3002102);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 103, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 7, 5.67, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 3002, 3002103);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 104, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 1, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 3002, 3002104);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (3, -416.5, 300, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 3, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 3004, 3002300);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (7, -416.5, 301, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 7, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 3005, 3002400);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (1, -416.5, 200, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 2, 4.4, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 3003, 3003200);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (7, -416.5, 201, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 7, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 3003, 3003201);
INSERT INTO `v1_c773ddc824fd2c3a9fbfbfc0076da76d91a438ce6f6457141a40258e4897886c` VALUES (2, -416.5, 202, "2030/01/01 14:59:59", 0.0, "2024/10/31 12:00:00", 130211, "フブキ", 1, 5.6, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 3003, 3003202);
